#
# Structure for table "regcuenta"
#

DROP TABLE IF EXISTS `regcuenta`;
CREATE TABLE `regcuenta` (
  `idRegCuenta` int(11) NOT NULL AUTO_INCREMENT,
  `desRegCuenta` varchar(255) NOT NULL DEFAULT '',
  `fecha` datetime DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`idRegCuenta`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;

